import React,{useState,useEffect} from 'react';
import axios from "axios";
var data=[];
function Myfunction()
{
  const [items, setItems]=useState([]);
  useEffect(()=>{
    axios.get("localhost/hotelbackend/getdata.php").then(res=>{
      setItems(res.data);
      console.log(res.data);
      data=res.data;
    });
  },[]);
}
export default data;
